async def handle_query(update, context):
    q = update.callback_query; await q.answer()
    v = get_user_vault(q.from_user.id, q.from_user.username)
    if "SET_" in q.data:
        val = int(q.data.split("_")[1]); context.user_data['stake'] = val
        await q.edit_message_text(f"‚úÖ <b>LOADED: ${val}</b>")
    elif "INT_" in q.data:
        idx = int(q.data.split("_")[1]); target = OMNI_STRIKE_CACHE[idx]
        # Display Timeframe Description
        type_str = f"‚è±Ô∏è <b>TYPE: {5 if target['priority']==2 else 15} MINUTE ULTRA-SHORT</b>\n" if target['priority']>0 else ""
        await q.edit_message_text(f"üéØ <b>TARGET:</b> {target['q']}\n{type_str}üìä <b>EST. PRICE:</b> ${target['price']}", reply_markup=InlineKeyboardMarkup([[InlineKeyboardButton("üí• EXECUTE ATOMIC STRIKE", callback_data=f"EXE_{idx}")]]), parse_mode='HTML')
    elif "EXE_" in q.data:
        idx = int(q.data.split("_")[1]); target = OMNI_STRIKE_CACHE[idx]
        stake = float(context.user_data.get('stake', 10))
        # ORACLE ANALYSING PROMPT
        oracle_m = await context.bot.send_message(q.message.chat_id, "üëÅÔ∏è <b>ANALYSING ORACLE...</b>", parse_mode='HTML')
        try:
            client = init_clob_for_vault(v)
            order_args = MarketOrderArgs(token_id=str(target['token_id']), amount=stake, side=BUY, price=0.999)
            signed = await asyncio.to_thread(client.create_order, order_args)
            resp = await asyncio.to_thread(client.post_order, signed, OrderType.FOK)
            if resp.get("success"):
                await oracle_m.edit_text("üöÄ <b>STRIKE SUCCESSFUL.</b> Oracle monitoring resolution...")
            else: await oracle_m.edit_text(f"‚ùå <b>FAILED:</b> {resp.get('errorMsg')}")
        except Exception as e: await oracle_m.edit_text(f"‚ö†Ô∏è <b>ERROR:</b> {str(e)[:50]}")

